package main

import "fmt"

func main() {
	withString := robotWithString("")
	fmt.Println(withString)
}

func robotWithString(s string) string {
	cnt := make([]int, 26)
	for _, c := range s {
		cnt[c-'a']++
	}
	fmt.Println(cnt)

	stack := []rune{}
	rlt := []rune{}

	minChar := 'a'
	for _, c := range s {
		stack = append(stack, c)
		cnt[c-'a']--

		// 如果最小的字符不是z, 并且比z小的字符还没有使用完, 那么就查找下一个字符是不是最小没消耗完的字符
		for minChar != 'z' && cnt[minChar-'a'] == 0 {
			minChar++
		}

		// 现在这个最小的字符一定是没有消耗完的, 代表在s剩余的部分里面还存在的

		// 如果现在stack 最后一位(栈顶的字符) 比剩余s里最小的还大, 意味着这个字符要取出来了
		for len(stack) > 0 && stack[len(stack)-1] <= minChar {
			// 取出来
			rlt = append(rlt, stack[len(stack)-1])
			stack = stack[:len(stack)-1]
		}
	}

	return string(rlt)
}

